// e.g. {{renderer :h1, hello world, green}}

logseq.App.onMacroRendererSlotted(({ slot, payload: { arguments } }) => {
  let [type, text, color] = arguments
  if (type !== ':h1') return
   logseq.provideUI({
     key: 'h1-playground',
     slot, template: `
      <h2 style="color: ${color || 'red'}">${text}</h2>
     `,
  })
})
